import React from 'react';

import classes from './Table.module.css';

const table = props => {
    const headers = null
    const body = props.data ? props.data.map( value => {
        console.log(value['_id']);
        return (
            <tr key={value['_id']}>
                {
                    Object.keys( value ).forEach( x => {
                        console.log(x);
                        return (<td> { value[x] }</td>);
                    })
                }
            </tr>
        )
    }) : <tr><td>Nothing to display</td></tr>;

    console.log(body);

    return (
        <table className={classes.Table}>
            <thead>
                <tr>
                    <td>1</td>
                    <td>2</td>
                    <td>3</td>
                    <td>4</td>
                    <td>1</td>
                    <td>2</td>
                    <td>3</td>
                    <td>4</td>
                </tr>
            </thead>
            <tbody>
                { body }
            </tbody>
        </table>
    )
};

export default table;
